oxy_webhelp_navlinks = {"microphone-d265e140":{"topics":[{"title":"移动式麦克风","shortdesc":"<p class=\"shortdesc\">便携可移动式麦克风是小巧方便的无线麦克风，适合教师或演讲者一边移动观察学生学习状况，又能让保证声音能够被麦克风正常放大。通过与设备配对，无需受有线限制。内置电池提供便利，方便实用。<\/p>","href":"mobile_microphone_task.html","attributes":{"data-id":"mobile_microphone_task"},"menu":{"hasChildren":false},"tocID":"mobile_microphone_task-d265e149","topics":[]},{"title":"固定式麦克风","shortdesc":"<p class=\"shortdesc\">固定式麦克风具有更为卓越的灵敏度，能够更好的采集教师或演讲者的声音，保证放大后的声音能够被学生听清楚。同时，使用者无需手持麦克风，能够将使用者的双手空出，从而更好的进行实验操作。<\/p>","href":"stationary_microphone_task.html","attributes":{"data-id":"stationary_microphone_task"},"menu":{"hasChildren":false},"tocID":"stationary_microphone_task-d265e160","topics":[]}]}};